  false,\n\t\"url\": null,\n\t\"notes\": \"This progress report provides an accounting
  of the accomplishments made during the second year of a multi-year water resource
  inventory in the coastal plain (1002 area), Arctic National Wildlife Refuge. This
  data represents the hydrologic conditions for one year, 1989. Additional years of
  data collection are required before any characterization of the hydrologic regime
  is appropriate. The objective of this years activities was to continue a program
  to quantify water yield and seasonal stream discharge of watersheds making up the
  1002 are of the Arctic National Wildlife Refuge.\",\n\t\"license_title\": \"License
